  false,\n\t\"url\": null,\n\t\"notes\": \"Data were gathered by the R/V Marion Dufresne
  in May and June of 1992 over the Mascarene Ridge in the Indian Ocean on cruise MD72/MASCAFLUX.
  Heat flow measurements for 96 in-situ readings including both thermal conductivity
  and thermal gradient were recorded along two profiles perpendicular to the mascarene
  ridge. NCEI also archives bathymetric and magnetic data from the cruise. Data correspond
  to: Bonneville, et al., EOS, 73, 43, p. 542, 1992. and Bonneville, A., R.P. Von
  Herzen and F. Lucazeau, Heat flow over Reunion hot spot track: additional evidence
  for thermal rejuvenation of oceanic lithosphere, Journal of Geophysical Research,
  1995. The data were sent to NCEI by Dr. Alain Bonneville for distribution.\",\n\t\"license_title\":
